import React, { useState } from "react";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import HighlightOffIcon from "@mui/icons-material/HighlightOff";
import "./Shifter.css";
import iconCustomShifter from "./Icon";

const Shifter = (props) => {
  return (
    <Grid
      container
      direction="column"
      justifyContent="space-between"
      alignItems="center"
    >
      <Grid item>
        {props.data.map((shifter) => {
          const shifterTime = shifter.time;
          const shifterName = shifter.employee;
          return (
            <div className="myBorder">
              <Typography variant="h6">
                {shifterTime.concat("   ", shifterName)}
              </Typography>
              <HighlightOffIcon/>
            </div>
          );
        })}
      </Grid>
    </Grid>
  );
};

export default Shifter;
